})A、HTML页面中显示的结果为：Original message: &quot;Hello&quot;Computed reversed message: &quot;olleH&quot;B、reversedMessage表示的是计算属性，随着message的值变化而重新计算C、上述代码中计算属性reversedMessage完全可以使用methods代替，两者除了写法有差异，其他的没有任何差别D、计算属性可以像绑定普通属性一样在模板中使用
